var hallScheme = {
  hoverTimer: 0,
  lastGroupId: null,
  arSelected: {},
  colored: [],
  color: {
    hover: '#FFFFFF',
    selected: '#FF0000'
  },
  init: function() {
    for (var event in this.events)
      svg.addEventListener(event, this.event_listener(this.events[event]));
    var orchestra_pit = svg.getElementById('orchestra_pit');
    var orchestra_pit_available = false;

    var svg_elements = svg.querySelectorAll('[bitrixid]');
    for (var i = 0; i < svg_elements.length; i++) {
      var svg_elem = svg_elements[i];
      var place = arPlace[svg_elem.getAttribute('bitrixid')];
      if (!place || place.IS_BUSY)
        continue;
      place.svg_elem = svg_elem;
      //svg_elem.setAttribute('id', 'place_' + place.ID);
      svg_elem.style.fill = place.PROPERTY_COLOR_VALUE;
      svg_elem.setAttribute('data-color', place.PROPERTY_COLOR_VALUE);
      if (svg_elem.parentNode == orchestra_pit)
        orchestra_pit_available = true;
    }

    //console.log({orchestra_pit_available});
    if (orchestra_pit) {
      if (!orchestra_pit_available) {
        orchestra_pit.style.display = 'none';
      } else {
        var orchestra_name = svg.querySelectorAll('.orchestra_name');
        for (var i = 0; i < orchestra_name.length; i++) {
          orchestra_name[i].style.display = 'none';
        }
      }
    }
  },
  event_listener: function(listener)
  {
    listener = listener.bind(this);
    return function(event) {
      var svg_elem = event.target;
      var key = svg_elem.getAttribute('bitrixid');
      var place = arPlace[key];
      if (!place || place.IS_BUSY)
        return;
      //if (!place.svg_elem)
      //  place.svg_elem = svg_elem;
      return listener(place);
    };
  },
  events: {
    mouseover: function(place, force)
    {
      if (isMobileView || (this.colored.length && !(place.JS.groupId in this.colored))) {
        return;
      }
      //console.log(place);
      if (this.lastGroupId != place.JS.groupId)
      {
        this.setColor(place, this.color.hover);
        this.lastGroupId = place.JS.groupId;
        this.showPlaceInfo(place);
      }
      else
      {
        this.renderTicketDetail(place);
        clearTimeout(this.hoverTimer);
      }
    },
    mouseout: function(place)
    {
      if (isMobileView || (this.colored.length && !(place.JS.groupId in this.colored))) {
        return;
      }
      this.hoverTimer = setTimeout(function() {
        if (!(place.JS.groupId in this.arSelected))
          this.setColor(place);
        else
          this.setColor(place, this.color.selected);

        if (this.lastGroupId == place.JS.groupId)
        {
          this.lastGroupId = '';
          this.hidePlaceInfo();
        }
      }.bind(this), 0);
    },
    click: function(place)
    {
      if (!(place.JS.groupId in this.arSelected))
        this.setSelect(place);
      else
        this.unSetSelect(place);
    }
  },
  setColor: function(place, color)
  {
    var placeColor = '';

    if (color)
      //if (typeof(color) != 'undefined')
      placeColor = color;
    else
      color = 0;

    for (var i in place.JS.arPlaceId)
    {
      var tmpPlace = arPlace[place.JS.arPlaceId[i]];
      if (!tmpPlace)
        continue;
      if (!color)
        placeColor = tmpPlace.PROPERTY_COLOR_VALUE;

      //console.log($('#place_'+place.JS.arPlaceId[i], svg).get(0));
      //$('#place_'+place.JS.arPlaceId[i], svg).css('fill', placeColor);
      //svg.querySelector('[bitrixid="'+place.JS.arPlaceId[i]+'"]').style.fill = placeColor;
      tmpPlace.svg_elem.style.fill = placeColor;
    }
  },
  setSelect: function(place)
  {
    if (!this.arSelected[place.JS.groupId])
    {
      var arPlaceInfo = {};
      arPlaceInfo[place.ID] = place.JS;
      var mobileInfo = '',
        groupNote = '',
        note = '';

      for (var i in place.JS.arPlaceId) {
        var tmpPlace = arPlace[place.JS.arPlaceId[i]];
        if (!tmpPlace)
          continue;
        arPlaceInfo[place.JS.arPlaceId[i]] = tmpPlace.JS;
        var placeNote = tmpPlace.JS.name + "\nЦена: "+ tmpPlace.JS.price +" руб.";
        if (!!tmpPlace.PROPERTY_NOTE_VALUE) {
          placeNote += " *";
          note = tmpPlace.PROPERTY_NOTE_VALUE;
        }
        if (!!tmpPlace.GROUP_NOTE) {
          groupNote = tmpPlace.GROUP_NOTE;
        }
        mobileInfo += (placeNote + "\n");
      }
      if (note) {
        mobileInfo += "* " + note + "\n";
      }
      if (groupNote) {
        mobileInfo += groupNote;
      }

      if (
        (isMobileView && !confirm(mobileInfo))
        || (this.colored.length && !(place.JS.groupId in this.colored))
      ) {
        return;
      }

      if (!this.arSelected[place.JS.groupId]) {
        this.setColor(place, this.color.selected);
        this.arSelected[place.JS.groupId] = true;
      }

      $('body').trigger('schemeSelectPlace', [place.JS.arPlaceId, arPlaceInfo, place.JS.groupId]);
    }
  },
  unSetSelect: function(place)
  {
    if (this.colored.length && !(place.JS.groupId in this.colored)) {
      return;
    }
    if (this.arSelected[place.JS.groupId])
    {
      if (this.lastGroupId == place.JS.groupId)
        this.setColor(place, this.color.hover);
      else
        this.setColor(place);

      delete this.arSelected[place.JS.groupId];

      if (isMobileView) {
        this.hidePlaceInfo();
      }

      $('body').trigger('schemeUnSelectPlace', [place.JS.arPlaceId]);
    }
  },
  setColored: function(place, color)
  {
    if (!this.colored[place.JS.groupId])
    {
      if (this.arSelected[place.JS.groupId]) {
        color = this.color.selected;
      }
      this.setColor(place, color);
      this.colored[place.JS.groupId] = true;
    }
  },
  unSetColored: function(place, color)
  {
    if (this.colored[place.JS.groupId])
    {
      delete this.colored[place.JS.groupId];
    }

    if (this.arSelected[place.JS.groupId]) {
      color = this.color.selected;
    }
    this.setColor(place, color);
  },
  showPlaceInfo: function(place)
  {
    var place_bcr = place.svg_elem.getBoundingClientRect();
    var iframe_bcr = iframe.getBoundingClientRect();

    place.y = pageYOffset + iframe_bcr.top + place_bcr.top;
    place.x = pageXOffset + iframe_bcr.left + place_bcr.left;

    if (isMobileView) {
      if (place.y + 250 > $(window).height())
        place.y -= 250;
    }

    if (place.x + 270 > $(window).width())
      place.x -= 270;

    /*
    box.style.top = scrollY + iframe_bcr.top + place_bcr.top + 'px';
    box.style.left = scrollX + iframe_bcr.left + place_bcr.left + 'px';
    */

    this.renderTicketDetail(place);

    place_info.style.left = place.x + 'px';
    place_info.style.top = place.y + 'px';
    place_info.style.display = 'block';
  },
  hidePlaceInfo: function()
  {
    place_info.style.display = 'none';
  },
  renderTicketDetail: function(place)
  {
    var notes_text = [];
    var group_notes = [];
    m.render(place_info, m('.ticket-detail',
      place.JS.image ?
        m('.preview',
          m('img', {src: place.JS.image})
        )
        : null,

      m('',
        m('.line',
          m('.place', place.JS.part_name.slice(0, place.JS.part_name.length - 1).join(' / ')),
          (isAdminUser || isMobileView) ?
            m('.close', {onclick: this.hidePlaceInfo.bind(this)}, '\xD7')
            : null,
          place.JS.arPlaceId.length > 1 ?
            m('.price', m.trust(place.JS.groupPriceFormated))
            : null
        ),

        place.JS.arPlaceId.map(function(group_place_id) {
          var group_place = arPlace[group_place_id];
          if (!group_place)
            return;
          if (
            group_place.PROPERTY_NOTE_VALUE &&
            notes_text.indexOf(group_place.PROPERTY_NOTE_VALUE) == -1
          ) {
            notes_text.push(group_place.PROPERTY_NOTE_VALUE);
          }
          if (
            group_place.GROUP_NOTE &&
            group_notes.indexOf(group_place.GROUP_NOTE) == -1
          ) {
            group_notes.push(group_place.GROUP_NOTE);
          }
          return m('.line',
            m('',
              {class: place.JS.arPlaceId.length > 1 ? 'row' : 'price'},
              m.trust(group_place.JS.priceFormated)
            ),
            m('.spot',
              group_place.JS.part_name[group_place.JS.part_name.length - 1],
              group_place.PROPERTY_NOTE_VALUE ?
                array_fill_str('*', notes_text.indexOf(group_place.PROPERTY_NOTE_VALUE) + 1)
                : null
            )
          )
        })
      ),

      (isAdminUser /* || isMobileView */) ?
        m('#place_info_btn.line.btn-wrap',
          // TODO: событие клика
          m('button.buy-tickets', phpVars.LANGUAGE_ID == 'ru' ? 'Выбрать' : 'Select')
        )
        : null,

      group_notes.length ?
        m('.line.noted', group_notes.map(function(note, i) {
          return [
            note,
            i < group_notes.length - 1 ? '\n' : null
          ];
        }))
        : null,

      notes_text.length ?
        m('.line.noted', notes_text.map(function(note, i) {
          return [
            array_fill_str('*', i + 1),
            ' ',
            note,
            i < notes_text.length - 1 ? '\n' : null
          ];
        }))
        : null
    ))
  }
};

function array_fill_str(str, count) {
  return Array.apply(null, Array(count)).map(String.prototype.valueOf, str);
}

var document_ready = $.Deferred();
$(document_ready.resolve);
$.when(document_ready, svg_loaded).then(hallScheme.init.bind(hallScheme));
//$.when(document_ready, svg_loaded).then(function() {
//});

$(function()
{
  $('body').unbind('controlUnSelectPlace');
  $('body').on('controlUnSelectPlace', function(e, key){
    hallScheme.unSetSelect(arPlace[key]);
  });

  place_info = document.getElementById('place_info');
  document.body.appendChild(place_info);

  $(document).on('click', '.rates-item', function() {
    var color = $(this).data('color'),
      $places = $('[data-color]', svg),
      $placesWithColor = $('[data-color="' + color + '"]', svg);

    if (!$(this).hasClass('active')) {
      $('.rates-item').removeClass('active');
      $(this).addClass('active');

      $places.each(function() {
        hallScheme.unSetColored(arPlace[this.getAttribute('bitrixid')], hallScheme.color.hover);
      });
      $placesWithColor.each(function() {
        hallScheme.setColored(arPlace[this.getAttribute('bitrixid')], $(this).data('color'));
      });
    } else {
      $(this).removeClass('active');
      $places.each(function() {
        hallScheme.unSetColored(arPlace[this.getAttribute('bitrixid')], $(this).data('color'));
      });
      hallScheme.colored = [];
    }
  });
});
